var failureDescription="";
function getDateDiff(inputDob, userDob)
{
  var parsedUserDob = new Date(userDob);
  var parsedInputDob = new Date(inputDob);

//   var diffInMillis = parsedInputDob.time.minus(parsedUserDob.time);
  var diffInMillis = Maths.abs(parsedInputDob - parsedUserDob);
  var diffInDays = diffInMillis / (1000 * 60 * 60 * 24);
  return Math.floor(diffInDays);
}

function getETDateTime()
{
    var now = new Date();
    var utc = now.getTime() + now.getTimezoneOffset() * 60000;

    var d= new Date(utc);
    var m = d.getUTCMonth() +1, day=d.getUTCDate(),dow=d.getUTCDay();
    var dst = (m>3 && m<11) ||(m===3 && day-dow>=8) || (m===11 && day-dow <1);

    var et=new Date(utc+(dst? -4: -5) * 3600000);
    var z=dst?"EDT":"EST";

    function p(n){return(n<10?"0":"")+n;}
    return et.getFullYear()+"-"+p(et.getMonth()+1)+"-"+p(et.getDate())+" "+p(et.getHours())+":"+p(et.getMinutes())+":"+p(et.getSeconds())+" "+z;
}

function logData(failureDescription)
{
